script: |
  super -f text -I q12966.spq | sort > q12966.out

inputs:
  - name: q12966.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE 3 + col1 + + col2 NOT BETWEEN + 66 * + + 54 + col0 + - 61 * - col2 AND + 32;
  - name: tab0

outputs:
  - name: q12966.out
    data: |
      15	81	47
      87	21	10
      97	1	99
